import React from 'react';
import { Formik, Form, ErrorMessage, useFormik, Field } from 'formik';
import BotonFormulario from '../botones/BotonFormulario';
import '../pages_css/Login.css'

const validaciones = () => {

}

const Login = () => {
  const formik = useFormik({
    initialValues: {
      username: '',
      password: '',
    },
    onSubmit: values => {
      alert(JSON.stringify(values, null, 2));
    },
 });

  return(
    <div>
      <h1>Página de Login</h1>
      <br/>
      <div className="plantilla-form">
        <div className="form">
          <h3>Login</h3>
          <Formik
            initialValues = {{
              username: '',
              password: ''
            }} 
            validate={validaciones}
            onSubmit={(values => alert(JSON.stringify(values, null, 2)))}
          > 
            <Form>
              <label>Usuario</label>
              <Field name="usuario" type="text"/>
              <ErrorMessage name="usuario"/>
              <label>Contraseña</label>
              <Field name="usuario" type="text"/>
              <ErrorMessage name="usuario"/>
            </Form>
          </Formik>
            <a href={'/SignUp'} rel="noopener noreferrer">No posee cuenta? Registrese!</a>
            <br/>
            <BotonFormulario className="boton-siguiente" name="boton" value="Ingresar" />
            <br/>
        </div>
      </div>
    </div>
  );
}

export default Login
